import React, { useState } from "react";
import { Modal, Button } from "antd";

const edit01 = props => {
  const { visible, setVisible, isLoading, setIsLoading } = this.props;
  handleOk = () => {
    this.setState({ isLoading: true });
    setTimeout(() => {
      setIsLoading(false), setVisible(false);
    }, 3000);
  };

  handleCancel = () => {
    this.setState({ visible: false });
  };

  return <div>EDITORE</div>;
};

export default edit01;
